import React from 'react';
import './App.jsx';

import ComParametro from './components/ComParametro';
import ComFilhos from './components/basicos/ComFilhos';
import Repeticao from './components/Repeticao';
import Card from './components/layout/Card';


export default (props) => (
    <div clasName="App">

        <Card titulo='#01 - Repetição'>
            <Repeticao></Repeticao>
        </Card>

        <Card titulo='#02 - Componente Com Filhos'>
                <ComFilhos>
                    <ul>
                        <li>Boeing 737-700 <img src='https://media.giphy.com/media/3o6nUN1sHVfSgjCj72/giphy-downsized-large.gif?cid=ecf05e479dhgl42w6b85tu05qy02strz7elblgfyctdpj62f&rid=giphy-downsized-large.gif&ct=g'/></li>
                        <li>Boeing 737-800</li>
                        <li>Boeing 737-800 MAX</li>
                        
                    </ul>
                </ComFilhos>
        </Card>

        <Card titulo='#03 - Componente Com Parametro'>
            <ComParametro titulo='Esse é o título' subtitulo='Esse é o subtítulo' imagem="https://media.giphy.com/media/3o6nUN1sHVfSgjCj72/giphy-downsized-large.gif?cid=ecf05e479dhgl42w6b85tu05qy02strz7elblgfyctdpj62f&rid=giphy-downsized-large.gif&ct=g"/>
            <ComParametro titulo='Esse é o título' subtitulo='Esse é o subtítulo' imagem="https://media.giphy.com/media/3o6nUN1sHVfSgjCj72/giphy-downsized-large.gif?cid=ecf05e479dhgl42w6b85tu05qy02strz7elblgfyctdpj62f&rid=giphy-downsized-large.gif&ct=g"/>
        </Card>

    </div>
)
